verse1:
Kei Topa a hing eive, tu’n  zong leitungah om;
A hin' kik ke’n thei gige, mite'n bang gen ta leh
Amah’n hong hehpih thei a, Hong hopihna ka za;
Amah ka sap laitakin hong nai gige.

verse2:
Ka kiim leitung mun kheempeuhah hong itna ka mu;
Lung khamna ka thuak zel hang, ka lungkia ngeih kei ding;
Huihpi nun'na tengah, Amah’n hong kha ke’n ka thei;
Amah hong kilat ding ni hong tung ding hi.

chorus:
Hansung pan hong thoto zo,
Vanglianpi tawh galte zogawp zo;
Khuamial gam pan Galzo in hong tho to hi,
A mi siangte maan’pih ding hingkik zo hi;
Hingkik zo, hingkik zo, Hallelujah hingkik zo.

verse1:
Topa kiang kong pai ding, Na teelsa lampi ah;
Nong sawlna bangbang mang dingin,
Kong ciam uh hi, Nang kiang.

verse3:
Kei aading, Topa, Nang nun' tak khomun;
Keimah ka suahtak na’ng, Nangma Thugun;
Nang tawh vantung luah na’ng, Nong vaak ding hi;
Hong it saak in thumaan, itna Na hi.

chorus:
An late kaw’h om. Kua hong kuan nuam;
An lak pawi sungah kua hong lungdam khawm nuam;
Kua’n hong khoppih ding buh lom hoih teng,
Mawhna lo sunga a om buh lom teng.

verse2:
Topa tu’n ka thei zo: Nangma vaanglian bek in;
Phak le lol zong damsak zo,
Suang lungneem sak tui bangin.

verse4:
Sihna lupna tung pan, Ka kha a kah to ding;
"Zeisu in keimah hong tan,"
Ci in lungdam kiko ding.

chorus:
Zeisu’n loh khin ta, Ama tung ka ba;
Si bang sansa ka mawhna,
Vuk bang hong sawp ngo ta.

verse3:
Mopina pawi sung zin a khop lai in;
Hong sap mi na hih leh tum in, tum in.
Omna om lai, tum in, tu in tum in.

verse2:
Hong pai in, hong damsak ding,
Na muang in, A' thu tak hi;
A sia bel pen zong saang ding;
Mawh neite Zeisu’n ngai hi.

verse3:
Meiipi hong kai manin, Lametna teng bei khin;
Naw-i vakhu bangin tuipi, Huihpi lakah ka leeng
Sawt loin meii thengin, Tuipi leh huih dai in;
Ka kha lungnuam in, nuam takin, A om hun ni ciangin.

verse1:
Mawhna sung ka om lai-in, Zeisu itna'n hong zong;
A lamdang hehpihna in, Hong kha kik tuu buk dong;
A thuk, a sang hehpihna, Tuipi sang zong thukzaw;
Vantung sangin zong sangzaw, Ka deih bel hi lo maw.

verse2:
Tanglai Judea gam sungah, Zeisu vak kawikawi a;
Hot khiatna thu thei nuam in, Mihon hong pai uh a;
Lung tamkhamte damsak in, Mittawte vaak sak hi;
A migitna lungsim in, Kei nangawn hong it hi.

verse3:
A lamdang hong itna hang, supna, baina hong thuak;
Singlamteh tungah gimna, Phun lo, pau lo in thuak;
Tatkhiat sa mi siangte tawh, I aw sangkhai ve ni;
Leitung, vantung thawnsak in, Ei hong Tanpa phat ni.

chorus:
A kumkum in nuam semsem, A kumkum in nuam semsem;
Zeisu itna lianzaw, Cingzaw, thukzaw, khumzaw,
A kumkum in nuam semsem.

verse1:
Pasian hong hehpih na’n, A geel hotkhiat kicing;
Lang do mite hon khia dingin,
A thupha sung hong teel.

verse2:
Hih Pasian thupha lian, Tapa ah kilang sak;
Zumhuai singlamteh ah thuak in,
Pasian thu kithang sak.

verse1:
Na khuavak le Na thuman hong zui sak in;
Na mual siangtho ah hong paipih sak in.
Na khuavak le Na thuman hong zui sak in;
Na mual siangtho ah hong paipih sak in.
Aw hong zui sak in, Aw hong zui sak in,
Na mual siangtho ah hong paipih sak in. Amen!

Kei lungsim sung, Nangmah’n ong veel dih in;
Ong sit tel in-la ka sung ong thei in;
Ngaihsut hoih lo khat peuh a om leh zong,
Ong sawpsak in ka lung sung a sian dong.

verse2:
Zeisu' khe-ah ka va khawlna, Mun nuam zaw om lo ding hi;
Lung sung vangik teng ka suahna, Tawldam nuam ka ngahna hi.
Zeisu' khe-ah kei va tu in, Duh le dah ka va ko hi;
Itna, hehnepna a cingin Ong pia khial ngei nailo hi.

Zeisu' thu ken sinsin nuam ing;
A deihna khentel thei nuam ing;
Pasian' Kha Siangtho ka Siapa’n,
Khazih thute kei hong hilh hi.

verse1:
Mite’n kei hong muhna ah, a genthei mi khat hing;
Mi zawng dai pam hong ci khial sa zen mah sing,
Nopna ka neih gige lam, lak khia nuam zen mah sing;
Nuam lua ing, Nong piak thupha hangin.

Ka kam tawh ka gen theih loh, lung nopna ke’n nei ing,
Topa in a khut tawh hong lawng hi;
Ka vangik teng tukkhia zo,
Satan zong om thei nawn lo;
Topa in a khut tawh hong lawng hi.

verse2:
Pasian in hong lawn' khit teh, dam siangtho khin pah ing,
Tuuno si in hong sawp siang zo hi;
Tu’n mi thak ka suakta a,
Khua zong ka mu thei ta hi;
Topa in a khut tawh hong lawng hi.

verse1:
Lamdang Zeisu hehpihna, Ka mawhna sang lian zaw;
Ka leei in bangci’n phat ding, Koi pan pan ding ka hiam?
Ka vangik teng hong paih sak, Ka kha hong suakta sak;
Lamdang Zeisu’ hehpihna in kei hong gum hi.

verse2:
Lamdang Zeisu hehpihna, Mangthangte kiang hong tung;
Mawhmaina ka ngahzo hi, A tawntung hot khiatna;
Kol khempeuh kisut khin ta, Suahtakna kei hong pia;
Lamdang Zeisu’ hehpihna in kei hong gum hi.

verse3:
Lamdang Zeisu hehpihna, Mawhnei pen kiang zong tung;
Hong khel vangliatna pi tawh, Pasian ta it suak sak;
Nopna leh van gam luah ding, Tawntung bei hun neilo;
Lamdang Zeisu’ hehpihna in kei hong gum hi.

verse1:
Thunget ding hong hilhin Topa aw;
Hih in nisim ka lunggulh pen hi;
Na zia Na tong ken ka thei nuam hi,
Thunget ding hong hilhin Topa aw

verse2:
Thungetna vanglian hong pia’n Topa;
Mawhna gentheihna hih simlei ah;
Mihing tampi mangthang den in si,
Hong pia in kei thunget vangliatna.

verse3:
Ka lungsim zawngkhal tha hong guan in;
Kamawh zong siatna hong paih sak in;
Vangliatna thak tawh kei hong tuam in,
Thunget vanglian leh sepna vanglian.

verse4:
Thunget ding hong hilhin Topa aw;
Nisim ka et-teh Nangmah bek mah;
Tawntung ka kha muanna in Nangmah,
Thunget ding hong hilh in Topa aw.

verse3:
Tua kui li nei khuapi ah;
Kong kikhak ngeilo hi;
Nuntakna tui luanna ah,
Zan cih om ngeilo hi.
